import styled from 'styled-components';
import Announcement from '../components/Announcement';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';
import Newsletter from '../components/Newsletter';
import {Add, Remove} from "@material-ui/icons";
import { mobile } from '../responsive';

const Container = styled.div`

`
const Wrapper = styled.div`
  padding: 50px;
  display: flex;
  ${mobile({padding: "10px", flexDirection: "column"})}
`
const ImgContainer = styled.div`
  flex: 1;

`
const Image = styled.img`
  width: 100%;
  object-fit: cover;
  ${mobile({height: "40vh"})}
`
const InfoContainer = styled.div`
  flex: 1;
  padding: 0px 50px;
  ${mobile({padding: "10px"})}
`
const Title = styled.h1`
  font-weight: 200;

`
const Desc = styled.p`
  margin: 20px 0px;
`
const Price = styled.span`
  font-weight: 100;
  font-size: 40px;
`
const FilterContainer = styled.div`
  width: 50%;
  margin: 30px 0px;
  display: flex;
  justify-content: space-between;
  ${mobile({width: "100%"})}
`
const Filter = styled.div`
  display: flex; 
  align-items: center;
`
const FilterTitle = styled.span`
  font-size: 20px;
  font-weight: 200;
`
const FilterColor = styled.div`
  width: 20px;
  height: 20px;
  border-radius: 50%;
  background-color: ${props=>props.color};
  margin: 0px 10px;
  cursor: pointer;
`
const FilterQuantity = styled.select`
  margin-left: 10px;
  padding: 5px;
`
const FilterQuantityOption = styled.option`
  
`
const AddContainer = styled.div`
  width: 50%;
  display: flex; 
  align-items: center;
  justify-content: space-between;
  ${mobile({width: "100%"})}
`
const AmountContainer = styled.div`
  display: flex; 
  align-items: center;
  font-weight: 700;
`

const BuyWishContainer = styled.div`
  width: 50%;
  display: flex;
  margin: 30px 0px;
  justify-content: space-between;
`

const Amount = styled.span`
  width: 30px;
  height: 30px;
  border-radius: 10px;
  border: 2px solid #005B96;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0px 5px;
`
const Button = styled.button`
  padding: 15px;
  border: 2px solid #005B96;
  background-color: white;
  cursor: pointer;
  font-weight: 500;

  &:hover{
    background-color: #e0ebf2;
  }
`
const WishlistAdd = styled.div`
  width: 30px;
  height: 10px;
  align-items: center;
  display: flex;
  textDecorationLine: 'underline';
  justify-content: center;
`


const Product = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>
        <Wrapper>
            <ImgContainer>
                <Image src="https://images.unsplash.com/photo-1527814750124-cd0a64d22bb9?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80"/>
            </ImgContainer>
            <InfoContainer>
                <Title>Poppy Bouquet</Title>
                <Desc>Lorem ipsum dolor sit amet, consectetur adipiscing elit, 
                    sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. </Desc>
                <Price>$20</Price>
                <FilterContainer>
                    <Filter>
                        <FilterTitle>Color: </FilterTitle>
                        <FilterColor color="red"/>
                        <FilterColor color="yellow"/>
                        <FilterColor color="orange"/>
                    </Filter>

                    {/*<Filter>
                        <FilterTitle>Size</FilterTitle>
                        <FilterQuantity>
                            <FilterQuantityOption>Single</FilterQuantityOption>
                            <FilterQuantityOption>Half Dozen</FilterQuantityOption>
                            <FilterQuantityOption>Dozen</FilterQuantityOption>
                           
                        </FilterQuantity>
  </Filter>*/}

                </FilterContainer>

                <AddContainer>
                  <AmountContainer>
                    <Remove/>
                    <Amount>1</Amount>
                    <Add/>
                  </AmountContainer>

                </AddContainer>

                <BuyWishContainer>
                  <Button>ADD TO CART</Button>
                  
                  </BuyWishContainer>
                  <WishlistAdd>Add to Wishlist</WishlistAdd>
                  

            </InfoContainer>
        </Wrapper>
        <Newsletter/>
        <Footer/>
    </Container>
  )
}

export default Product
